import React, { useState } from "react";
import img from "../../components/img/Screen Shot 2023-06-14 at 11.45 2.png";
import img2 from "../../components/img/We all need a little help sometimes.png";
import { Link } from "react-router-dom";
import LocationMap from "../../components/location/LocationMap";
import { GoogleAutocomplete } from "react-google-autocomplete";
import "./home.css";

export default function Home1() {
  const [searchText, setSearchText] = useState("");

  const handleSearch = () => {
    // Implement your search functionality here based on the value of searchText
    // For example, you can call a search API or perform geocoding to get the latitude and longitude of the entered address.
    console.log("Search Address:", searchText);
  };

  return (
    <>
      <div className="topleft">
        <Link to="/">
          <img className="img2" src={img2} alt="Image" />
        </Link>
        <Link to="/">
          <img className="img" src={img} alt="Image" />
        </Link>
      </div>
      <div className="home">
        <div className="search-box">
          <GoogleAutocomplete
            apiKey="YOUR_GOOGLE_MAPS_API_KEY"
            onPlaceSelected={(place) => {
              setSearchText(place.formatted_address);
            }}
            types={['address']}
            placeholder="Enter an address"
            className="search-input"
          />
          <button onClick={handleSearch}>Search</button>
        </div>
        <LocationMap />
      </div>
    </>
  );
}
